import React from 'react';

const Extra = ({ match }) => {
    const name = match.params.name;
    return (
    <>
    <h1>Some Extra Info about me</h1>
    <p>I'll add this later.</p>
    <p>
        This is the {name} article
    </p>
        </>
);
    }

export default About;
